import React, { useEffect, useState } from 'react'
import { Row, Col } from 'antd';
import 'antd/dist/antd.css';
import './DetailPokemon.css'
import { callApidata } from '../../api/callAPI';
import { values } from 'mobx';
const Skill=({values})=>(
    <div> 
        <p>{values.name}</p>
        <p>{values.url}</p>
    </div>
)
function Detail(){
    useEffect(()=>{
        callApidata('102','pokemon').then(res=>{
            setIF(res.data)
        })
    },[])
    const [inforPokemon,setIF]=useState({})
    console.log(inforPokemon)
    if (inforPokemon.sprites!== undefined){
        return(
            <Row gutter={[16, 16]} className="detail">
                <Col span={6} ></Col>
                <Col span={12}>
                    <Row>
                        <Col span={12}> 
                            <img src={inforPokemon.sprites.back_default}></img>
                        </Col>
                        <Col span={12}> 
                            <p>Kỹ Năng :</p>
                            {inforPokemon.abilities.map(values=>
                                // console.log('a')
                                <div> 
                                    <p>{values.ability.name}</p>
                                    <p>{values.ability.url}</p>
                                </div>
                                
                            )}
                        </Col>
                    </Row>
                </Col>
                <Col span={6} ></Col>
            </Row>
        )
    } else {
        return(
            <div></div>
        )
    }
    
}
export default Detail
